selector_to_html = {"a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><h3>Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>The closed-loop transfer function is still</p>", "a[href=\"#question-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#question-2\" title=\"Link to this heading\">#</a></h3><p>To appreciate the effect of <span class=\"math notranslate nohighlight\">\\(v\\)</span> on the output, we compute the transfer function between <span class=\"math notranslate nohighlight\">\\(v\\)</span> and <span class=\"math notranslate nohighlight\">\\(y\\)</span>. We can ignore the reference at this stage (<span class=\"math notranslate nohighlight\">\\(r=0\\)</span>) because of the superimposition principle.</p>", "a[href=\"#solutions-of-exercise-4-3\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 4.3<a class=\"headerlink\" href=\"#solutions-of-exercise-4-3\" title=\"Link to this heading\">#</a></h1><p>A system <span class=\"math notranslate nohighlight\">\\(G(s) = \\frac{5}{s+2}\\)</span> is affected by a disturbance <span class=\"math notranslate nohighlight\">\\(v\\)</span> via a transfer function <span class=\"math notranslate nohighlight\">\\(H(s) = \\frac{s+10}{s+2}\\)</span>.</p><p>The system is controlled with a proportional controller <span class=\"math notranslate nohighlight\">\\(F(s) = K\\)</span>, with <span class=\"math notranslate nohighlight\">\\(K &gt; 0\\)</span>, as shown in <a class=\"reference internal\" href=\"#fig-lec4-ex3-sol\"><span class=\"std std-numref\">Fig. 28</span></a>.</p>", "a[href=\"#question-3\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 3<a class=\"headerlink\" href=\"#question-3\" title=\"Link to this heading\">#</a></h3><p>The disturbance <span class=\"math notranslate nohighlight\">\\(v\\)</span> is measurable, therefore we can use a feed-forward compensator <span class=\"math notranslate nohighlight\">\\(F_{ff}(s)\\)</span> as in the figure below.</p>", "a[href=\"#question-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>The closed-loop transfer function is still</p>", "a[href=\"#fig-lec4-ex3-sol\"]": "<figure class=\"align-default\" id=\"fig-lec4-ex3-sol\">\n<a class=\"reference internal image-reference\" href=\"../_images/ex3-block.svg\"><img alt=\"../_images/ex3-block.svg\" src=\"../_images/ex3-block.svg\" style=\"height: 225px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28 </span><span class=\"caption-text\">Block diagram of a system affected by a disturbance <span class=\"math notranslate nohighlight\">\\(v\\)</span></span><a class=\"headerlink\" href=\"#fig-lec4-ex3-sol\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#fig-lec4-ex3-sol-ff\"]": "<figure class=\"align-default\" id=\"fig-lec4-ex3-sol-ff\">\n<a class=\"reference internal image-reference\" href=\"../_images/ex3-block-ff.svg\"><img alt=\"../_images/ex3-block-ff.svg\" src=\"../_images/ex3-block-ff.svg\" style=\"height: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 29 </span><span class=\"caption-text\">Control scheme with feed-forward disturbance compensator, <span class=\"math notranslate nohighlight\">\\(F_{ff}(s)\\)</span>.</span><a class=\"headerlink\" href=\"#fig-lec4-ex3-sol-ff\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
